import React from 'react';

import PictureButton from './../../components/PictureButton.js'
import RectanglePolaroid from './../../components/RectanglePolaroid.js'

import './Landing.css';
import design from './../../assets/design.jpeg';
import software from './../../assets/software.png';

import o from './../../assets/onlo@2x.png';
import bd from './../../assets/datathon@2x.png';
import s from './../../assets/spotify@2x.png';
import sc from './../../assets/sproul@2x.png';
import t from './../../assets/tigertalk@2x.png';
import a from './../../assets/akron@2x.png';

function Landing() {
  var onlo = <img class="image" src={o}></img>;
  var data = <img class="image" src={bd}></img>;
  var spot = <img class="image" src={s}></img>;
  var spcl = <img class="image" src={sc}></img>;
  var tigr = <img class="image" src={t}></img>;
  var akrn = <img class="image" src={a}></img>;

  return (
      <div class="landing">
            <div class="text-container">
                <p class="big-text"> Izzie Lau </p>
                <p class="text"> 📍 <b>Sunnyvale, California</b> </p>
                <p class="text"></p>
                <p class="text">Software Engineer @ <b>Microsoft</b></p>
                <p class="text">CS + Cognitive Science '22 @ <b>UC Berkeley</b></p>
                <p class="text"></p>
            </div>
            <div class="button-container">
                <RectanglePolaroid title="Machine Learning Engineer @ Microsoft" subtitle="Lorem ipsum dolor sit amet, consectetur adipiscing elit." link="/" image={micr}> </RectanglePolaroid>
                <RectanglePolaroid title="Product Manager @ Develop for Good" subtitle="Lorem ipsum dolor sit amet, consectetur adipiscing elit." link="/" image={akrn}> </RectanglePolaroid>
                <RectanglePolaroid title="UI/UX Intern @ TigerTalk" subtitle="Lorem ipsum dolor sit amet, consectetur adipiscing elit." link="/" image={tigr}> </RectanglePolaroid>
                <RectanglePolaroid title="Blueprint Datathon: COVID-19 Research Project [1st]" subtitle="Lorem ipsum dolor sit amet, consectetur adipiscing elit." link="/" image={data}> </RectanglePolaroid>
                <RectanglePolaroid title="UI/UX Designer @ OnLo" subtitle="Lorem ipsum dolor sit amet, consectetur adipiscing elit." link="/" image={onlo}> </RectanglePolaroid>
                <RectanglePolaroid title="UI/UX Designer @ OnLo" subtitle="Lorem ipsum dolor sit amet, consectetur adipiscing elit." link="/" image={onlo}> </RectanglePolaroid>
                <RectanglePolaroid title="Frontend Engineer @ sproul.club" subtitle="Lorem ipsum dolor sit amet, consectetur adipiscing elit." link="/" image={spcl}> </RectanglePolaroid>
            </div>
      </div>
  );
}

export default Landing;
